import Foundation
import CoreLocation
import SwiftCSV

struct LibraryListItemModel: Decodable {
    let name: String
    let comment: String
    let accessibility: String
}

struct BathroomListItemModel: Decodable {
    let lat: CLLocationDegrees
    let lng: CLLocationDegrees
    let name: String
    let comment: String
    let accessibility: String?
    let id: String
}

struct Constants {
    static func getBathrooms() -> [Bathroom] {
    let decoder = JSONDecoder()
    
    guard let jsonData = Constants.bathroomList.data(using: .utf8) else {
        print("Error: Cannot convert string to Data")
        return []
    }
    
    do {
        let listItems = try decoder.decode([BathroomListItemModel].self, from: jsonData)
        
        let bathrooms: [Bathroom] = listItems.compactMap { item in
            let coordinate = CLLocationCoordinate2D(latitude: item.lat, longitude: item.lng)
            
            return Bathroom(name: item.name, accessibility: Accessibility(rawValue: item.accessibility ?? "unknown") ?? .unknown, coordinate: coordinate, comment: item.comment, id: item.id, url: nil)
        }
        
        
        let resource: CSV? = try CSV<Named>(
            name: "libraries",
            extension: "csv",
            bundle: .main,
            encoding: .utf8)
        if let rows = resource?.rows {
            for row in rows {
                if let name = row["Name"], let address = row["Address"], let city = row["City"], let postcode = row["Zip"], let lat = row["Latitude"], let latDouble = Double(lat), let lng = row["Longitude"], let lngDouble = Double(lng), let url = row["URL"] {
                    let id = self.randomizeAndHyphenateWords(in:  address) + UUID().uuidString
                    let fullAddress = address + " " + city + ", NY " + postcode
                    
                    var fullName = name
                    if !fullName.contains("Library") {
                        fullName = name + " Library"
                    }
                    let bathroom = Bathroom(name: fullName, accessibility: .unknown, coordinate: CLLocationCoordinate2D(latitude: latDouble, longitude: lngDouble), comment: fullAddress, id: id, url: url)
                    print(bathroom.description)
                } else {
                    print("Failed: \(row)")
                }
            }
        }
        
        
        return Array(Set(bathrooms))
    } catch {
        print(error)
    }
    
    
    return []
}
    
